import React from 'react';

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';

import './Nav.scss';

const Navigation = function() {
    return (
        <Navbar  bg="white">
            <Container>
                <Navbar.Brand href="#"></Navbar.Brand>
                <span class="d-inline d-md-none mobile-h1 text-primary"><span class="d-inline d-md-none">matching listings</span></span>
                <Navbar.Collapse className="justify-content-end">
                    <Nav className="d-none d-md-flex">
                        <Nav.Link href="https://www.develop.realtystore.com/Membersite/?from=banner">
                            <i class="fa fa-user"></i> Member Sign-in
                        </Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    )
}

export default Navigation;
